import React from 'react'

const Cards = ({results}) => {
    
    let display;
    console.log(results)

    if(results){
        display = results.map(x=>{
            let {id , name , image , location , gender , species , status ,type } = x;
            return (
            <div key={id} className='col-4 text-light'>
                <div className=''>
                    <img src={image} alt="" className="img-fluid"/>
                    <div className='content'>
                        <div className="fs-3 fw-bold mb-2">{name}</div>
                        <div className="mb-4">
                            <div className="fs-5 bg-secondary fw-light">{gender} - {species}</div>
                            <div className="fs-6">last seen in-<br></br><span className='fs-6 bg-info text-dark pd-2'>{location.name}</span></div>
                        </div>
                    </div>
                </div>
            </div>
            );
        });
    }else{
        display = "404 - Not Found :("
    }
    return <> {display} </>;
}

export default Cards
